import Header from './Header'
import Footer from './Footer'

class UploadEmr extends Component{

    constructor(props) {
        super(props)
        this.state = {
            permission:false,
            hasError: false,
            mgs: ''
        }
      }

    render() {

        return (
          <mean>
          <Header account = {this.props.location.state.account} />
              <h1>Add a ne</h1>
          <Footer/>
    </mean>
        );
    }
}
export default UploadEmr;
